import React, { Component } from 'react';
import { withStyles } from '@material-ui/styles';
import Decease from '../../assets/icons/archive.svg';
import archieve from '../../assets/icons/archive.svg';
import { isEmpty } from 'lodash';

import { Grid, Paper, Typography } from '@material-ui/core';
import Chip from '@material-ui/core/Chip';
import Cards from '../core/paper';

const styles = (theme) => ({
    logo: {
        width: '159px',
        height: '38px',
        border: '0',
        marginBottom: '50px',
    },

    title: {
        textAlign: 'center',
        font: 'Medium 20px/30px Roboto',
        letterSpacing: 0,
        color: '#212529',
        textTransform: 'capitalize',
        opacity: ' 1',
    },
    head: {
        textAlign: 'center',
        font: ' Bold 35px/45px PT Sans',
        letterSpacing: '0',
        color: '#212529',
        opacity: '1',
    },
    para: {
        textAlign: 'center',
        font: ' Regular 18px/27px PT Sans',
        letterSpacing: 0,
        color: '#868E96',
        opacity: '1',
        marginTop: '22px',
    },
    data: {
        justifyContent: 'center',
        display: 'flex',
        flexWrap: 'wrap',
        '& > :nth-child(n+1)': {
            margin: '16px',
            hover: 'pointer',
        },
    },
});
class fullcards extends Component {
    constructor(props) {
        super(props);
        this.state = {
          cards: [],
        };
    }

    componentDidMount = () => {
        const cards = [
          {
            title: 'District population',
            text:
              'This should be used to tell a story and let your users know more about your service. How can you benefit them?',
            image: Decease,
            datasets: '40',
          },
          {
            title: ' Child care',
            text:
              'This should be used to tell a story and let your users know more about your service. How can you benefit them?',
            image: Decease,
            datasets: 15,
          },
          {
            title: 'Decease ',
            text:
              'This should be used to tell a story and let your users know more about your service. How can you benefit them?',
            image: Decease,
          },
        ];
        this.setState({
          cards,
        });
      };

    render() {
        const { classes } = this.props;
        const { cards } = this.state;
        console.log(cards, '=====================')
        return (
            <div style={{ backgroundColor: '#FFFFFF' }}>
                <div
                    style={{ padding: '100px' }}
                    container
                    direction="column"
                    justify="center"
                    alignItems="center"
                >
                    <Typography className={classes.head}>
                        Find insights in the district level
                    </Typography>
                    <div>
                        <Typography className={classes.para}>
                            Datasets organized in district level.
                        </Typography>
                    </div>
                </div>

                {!isEmpty(cards) &&
          cards.map((item) => {
            return <cards data={item} />;
          })}
            </div>
        );
    }
}
export default withStyles(styles)(fullcards);
